export const defaultData = {
  CONTEXT: "outbound-powen-callme",
  INCOMINGCONTEXT: "callme-powen",
  campaign: "powen",
  defaultCampaignData: {
    on: 1,
    c2c: 1,
    number: 1,
    sabado: 0,
    start: "10:00:00",
    end: "19:00:00",
    source: "POWEN",
    sub_source: "POWEN",
  },
  phoneNumbers: {
    default: { phone: "200 000 000", mobile: "200 000 000" },
  },
};
